import React, { Component } from "react";
import "./App.css";

import NavBar from "./components/navbar";
import Menu from "./components/menu";

class App extends Component {
	render() {
		return (
			<div>
				<NavBar />
				<main className="container">
					<Menu />
				</main>
			</div>
		);
	}
}

export default App;
